import "./Music.css";
import Nav from "./../Nav/Nav.js";
import "../../App.css";

const Music = () => {
    return (
        <div>
            <Nav />
            <div className="music">
                <h2>WORK IN PROGRESS</h2>
                <div className="description-box">
                    <span className="description">this page will display my music endeavors.</span>
                    <br/>
                    <ul>
                        <li>
                        i sing & play the guitar at art shows & coffee shops
                        </li>
                    </ul>
                    <span className="description">i sing & play the guitar at art shows & coffee shops</span>
                </div>
            </div>
        </div>
    )
}

export default Music;
